import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';  // You can define your CSS styles here
import App from './App';  // This is the main component of your app
import reportWebVitals from './reportWebVitals';  // Optional, for performance tracking

// Rendering the main App component into the 'root' div in index.html
ReactDOM.render(
  <React.StrictMode>
    <App />  {/* App component holds your main UI and logic */}
  </React.StrictMode>,
  document.getElementById('root')  // This refers to the div in public/index.html
);

// Optional: To measure performance in your app, you can pass a function to log results
reportWebVitals();
